import React from "react";

class Header extends React.Component {
  dietDropdown = () => {
    document.getElementById("dietDropdown").classList.toggle("extend");
  };

  workoutDropdown = () => {
    document.getElementById("workoutDropdown").classList.toggle("extend");
  };

  /* window.onClick = (e) => {
    if (!event.target.matches("."))
  }; */

  render() {
    return (
      <header id="header">
        <div className="title">
          <a href="#">
            <h1>Fit Progress</h1>
          </a>
          <p>
            Fit Progress is the best platform to help you track your nutrient
            intake along with your workouts.
          </p>
        </div>

        <div className="navbar">
          <a className="bignav">Water</a>
          <a className="bignav" onClick={this.dietDropdown}>
            Diet &#9660;
          </a>
          <a className="bignav" onClick={this.workoutDropdown}>
            Workout &#9660;
          </a>
          <a className="bignav signButton">Sign In</a>
          <a className="bignav signButton">Sign Up</a>
          <a className="smallnav">&#9776;</a>

          <div id="dietDropdown" className="dietDropdown">
            <a>Ingredients</a>
            <a>Dishes</a>
            <a>Meals</a>
          </div>
          <div id="workoutDropdown" className="workoutDropdown">
            <a>Running</a>
            <a>Pushups</a>
            <a>Dips</a>
            <a>Pullups</a>
            <a>Situps</a>
            <a>Plank</a>
            <a>Squats</a>
            <a>Lounges</a>
          </div>
        </div>
      </header>
    );
  }
}

export default Header;
